<?phpnamespace Nemundo\App\ModelDesigner\Page;use Nemundo\Admin\Com\Button\AdminSiteButton;use Nemundo\Admin\Com\Layout\AdminFlexboxLayout;use Nemundo\Admin\Com\Title\AdminTitle;use Nemundo\App\ModelDesigner\Com\Breadcrumb\ModelDesignerBreadcrumb;use Nemundo\App\ModelDesigner\Com\Table\AppTable;use Nemundo\App\ModelDesigner\Com\Table\ProjectTable;use Nemundo\App\ModelDesigner\Parameter\ProjectParameter;use Nemundo\App\ModelDesigner\Site\App\AppNewSite;use Nemundo\App\ModelDesigner\Site\ModelDesignerSite;use Nemundo\App\ModelDesigner\Template\ModelDesignerTemplate;class ProjectPage extends ModelDesignerTemplate{    public function getContent()    {        $layout = new AdminFlexboxLayout($this);        $breadcrumb = new ModelDesignerBreadcrumb($layout);        $project = (new ProjectParameter())->getProject();        $breadcrumb->addActiveItem($project->project);        $btn = new AdminSiteButton($layout);        $btn->site = AppNewSite::$site;        $btn->site->addParameter(new ProjectParameter());        new AppTable($layout);        return parent::getContent();    }}